import React from 'react';
import Fetch from './fetch';
import Login from './Login';
 export default App = () =>{
  useEffect(() => {
    axios.get("https://jsonplaceholder.typicode.com/todos")
      .then((response) => console.log(response.data));
    }, []);

  return (
    <View>
      <Text>Different ways to fetch Data</Text>
    </View>
  );
 }
